CREATE TABLE Products.dbo.products (
	Id uniqueidentifier NOT NULL,
	Name varchar(255) COLLATE SQL_Latin1_General_CP1_CI_AS NOT NULL,
	Description varchar(2048) COLLATE SQL_Latin1_General_CP1_CI_AS NULL,
	Price decimal(38,0) NOT NULL,
	PriceOffer decimal(38,0) NOT NULL,
	PromotionCode varchar(100) COLLATE SQL_Latin1_General_CP1_CI_AS NULL,
	PromotionPrice decimal(38,0) NULL,
	ImageBase64 varchar(MAX) COLLATE SQL_Latin1_General_CP1_CI_AS NULL,
	CONSTRAINT products_pk PRIMARY KEY (Id)
);

